import {BrowserRouter, Routes, Route} from "react-router-dom";
import MyShows from "./Home";
import ListShows from "./listShows";
import AddAShow from "./AddAShow";
import "./App.css";

function App() {
    return (
        <Router>
            <Navbar />
            <Routes>
                <Route exact path="/" element={<MyShows/>} />
                <Route path="/my-passport" element={<ListShows data={seenOnBway} />} />
                <Route path="/add-a-show" element={<AddAShow />} />
            </Routes>
        </Router>
    );
}
export default App;
